import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
            <NavBar/>
            <main>
               <VideoSection/>


            </main>

      </div>
    );
  }
}

class NavBar extends React.Component {
  render() {

    return (
      <header class="header">
            <div class="header__logo">
            <img className="logo-photo" src="./Assets/Icons/BrainFlix Logo.svg"></img>
            </div>
            <div class="header__links header__links--right">
              <input class="search" placeholder="Search..." />
              <img className="search-button" src="/Assets/Icons/Search.svg"></img>
            </div>
            <img className="upload-video" src="/Assets/Icons/Content Upload.svg"></img>
      </header>
    );
  }
}


class VideoSection extends  React.Component {
  render() {

    return (
      <section className="video__section">
<iframe width="560" height="315" src="https://www.youtube.com/embed/MGslEcmVurg" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen></iframe>        <p>Jose Bautista hammers go-ahead three-run shot in ALDS Game 5, delivers epic bat flip</p>
        <div className="video__section--comments">
          <p className="video__section--views">2,304,189 views</p>
          <div className="video__comments video__comments--right">
            <img className="up" src="/Assets/Icons/Thumbs Up.svg" ></img>
            <img className="down" src="/Assets/Icons/Thumbs Down.svg" ></img>
            <img className="share" src="/Assets/Icons/Share.svg"></img>
          </div>
        </div>
      </section>
    );
  }
}









export default App;
